const Home = () => {
  return (
    <div>
      <Header />
      <div className="main-container">
        <div className="hero-text">
          <h1 className="name">Dale Warburton</h1>
          <p className="welcome">I am a junior full stack developer,<br/>welcome to my portfolio site</p>
          <h3 className="recent-projects">Recent projects</h3>
        </div>
        <div className="projects-container">
          <Link to="/lilypad">
            <img src={lilyPadImage} alt="LilyPad Project" className="project-image" /> {/* Use the imported image variable */}
          </Link>
        </div>
      </div>
      <CallToAction />
      <Footer />
    </div>
  );
};

export default Home;
